import React from 'react';
import './SideButton.css';
import {
  Link
} from "react-router-dom";

class SideButton extends React.Component{
	constructor(props){
		super(props)
	}

	selected(){
		this.props.click();
	}

	render(){
		return (
			<Link to={"/"+this.props.pathName}>{this.props.pathName}</Link>
		)
	}
}

export default SideButton;
